  `fdesc` varchar(5000) DEFAULT NULL COMMENT '描述',
  `fprice` decimal(10,2) DEFAULT NULL COMMENT '价格',
  `fimages` varchar(1000) DEFAULT NULL COMMENT '图片',
  `fvideo` varchar(255) DEFAULT NULL COMMENT '视频',
  `faddress` varchar(255) DEFAULT NULL COMMENT '产地',
  `ftype` varchar(255) DEFAULT NULL COMMENT '类型',
